import React, { Component } from 'react';
import './Table.css';
class Table extends React.Component {
    render() {
        const items = this.props.items;
        return (
            <div >
                <table id="customers">
                    <tbody>
                        <tr>
                            <th>ID</th>
                            <th>Username</th>
                            <th>Phone</th>
                            <th>StartDate</th>
                            <th>EndDate</th>
                            <th>Action</th>

                        </tr>
                        {items.map(item => {
                            return (
                                <tr>
                                    
                                    <td contenteditable="true">{item.username}</td>

                                    <td contenteditable="true">{item.phone}</td>
                                    <td contenteditable="true">{item.startDate}</td>
                                    <td contenteditable="true">{item.endDate}</td>
                                    <td contenteditable="false">{item.action}
                                    <button onClick={this.props.handelDelete.bind(null,item)}>Delete</button>
                                   
                                    </td>
                                    
                                </tr>
                            );
                        })}
                    </tbody>
                </table>
            </div>
        );
    }
}

export default Table;
